import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import { store } from './_helpers';
import './index.css';
import {App} from './App';
import reportWebVitals from './reportWebVitals';
import jwt from 'jsonwebtoken'

// check user authentication here
//https://stackoverflow.com/questions/49865521/how-to-persist-jsonwebtoken-on-page-reload-after-deploying-react-app

if (localStorage.getItem(user-auth)) {
  //setAuthorizationToken(localStorage.jwtToken)
  store.dispatch(setCurrentUser(jwt.decode(localStorage.getItem(user-auth))))
}

ReactDOM.render(
  <React.StrictMode>
   <Provider store={store}>
      <App />
   </Provider> 
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
